CONNECT 'jdbc:derby:eFoods;create=true';
CREATE SCHEMA ROUMANI;
SET SCHEMA ROUMANI;

CREATE TABLE CATEGORY (
        ID INTEGER NOT NULL, -- ID INTEGER DEFAULT AUTOINCREMENT: start 1 increment 1 NOT NULL GENERATED ALWAYS AS IDENTITY  (START WITH 1 ,INCREMENT BY 7),
        NAME VARCHAR(20),
        DESCRIPTION VARCHAR(50),
        PICTURE BLOB(1048576)
    );
CREATE UNIQUE INDEX SQL110804095914150 ON CATEGORY (ID ASC);
ALTER TABLE CATEGORY ADD CONSTRAINT SQL110804095914150 PRIMARY KEY (ID);

CREATE TABLE ITEM (
        NUMBER CHAR(8) NOT NULL,
        NAME VARCHAR(50),
        PRICE DOUBLE,
        QTY INTEGER,
        ONORDER INTEGER,
        REORDER INTEGER,
        CATID INTEGER,
        SUPID INTEGER,
        COSTPRICE DOUBLE,
        UNIT VARCHAR(20)
    );
CREATE UNIQUE INDEX SQL110802161751630 ON ITEM (NUMBER ASC);
ALTER TABLE ITEM ADD CONSTRAINT SQL110802161751630 PRIMARY KEY (NUMBER);

